class App extends React.Component {
  render() {
    return (
      <HashRouter basename="/" history={history}>
        <Switch>
          <Route exact path="/" component={ReactLeaflet} />
        </Switch>
      </HashRouter>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
